import React from 'react';
import './Career.css';

// Mock Data
const creatorsData = [
  {
    name: 'Alice Johnson',
    bio: 'Digital Artist and Content Creator',
    profilePic: 'https://via.placeholder.com/150',
    socialMedia: [
      { platform: 'Twitter', url: 'https://twitter.com' },
      { platform: 'Instagram', url: 'https://instagram.com' }
    ]
  },
  {
    name: 'John Smith',
    bio: 'Technology Blogger & Vlogger',
    profilePic: 'https://via.placeholder.com/150',
    socialMedia: [
      { platform: 'YouTube', url: 'https://youtube.com' },
      { platform: 'LinkedIn', url: 'https://linkedin.com' }
    ]
  },
  {
    name: 'Emma Carter',
    bio: 'Fitness Enthusiast & Coach',
    profilePic: 'https://via.placeholder.com/150',
    socialMedia: [
      { platform: 'Instagram', url: 'https://instagram.com' },
      { platform: 'TikTok', url: 'https://tiktok.com' }
    ]
  }
];

const Career = () => {
  return (
    <div className="career-container">
      <h1>Meet Our Creators</h1>
      <div className="career-list">
        {creatorsData.map((creator, index) => (
          <div className="career-card" key={index}>
            <img className="profile-pic" src={creator.profilePic} alt={creator.name} />
            <h3 className="creator-name">{creator.name}</h3>
            <p className="creator-bio">{creator.bio}</p>
            <div className="social-links">
              {creator.socialMedia.map((link, idx) => (
                <a
                  key={idx}
                  href={link.url}
                  target="_blank"
                  rel="noopener noreferrer"
                  className="social-link"
                >
                  {link.platform}
                </a>
              ))}
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Career;
